import { ClientProtocol, SerdeContext, UrlParser } from "@smithy/types";

export type PreviouslyResolved = Pick<SerdeContext & {
    urlParser: UrlParser;
    protocol: ClientProtocol<any, any>;
}, Exclude<keyof (SerdeContext & {
    urlParser: UrlParser;
    protocol: ClientProtocol<any, any>;
}), "endpoint">>;
